import React from "react";
import "../styles/home.css";

function Home() {
    return (
        <div className="home">
            <div className="home-content">
                <h2 className="home-title">Welcome to Jenkins!!!</h2>
                <span className="home-text">
                    Welcome to our website! Here you can do whatever you want,
                    try whatever you want, set it up the way you need it and do
                    it in very short periods of time. Enjoy it!
                </span>
            </div>
        </div>
    );
}

export default Home;
